	<script id="vshader7" type="x-shader/x-vertex">
	attribute vec3 aPos;
	attribute vec4 aCol;
	uniform mat4 mvMatrix;
	uniform mat4 prMatrix;
	varying vec4 vCol;
	varying vec4 vPosition;
	void main(void) {
	  vPosition = mvMatrix * vec4(aPos, 1.);
	  gl_Position = prMatrix * vPosition;
	  gl_PointSize = 1.;
	  vCol = aCol;
	}
	</script>

      vec4 colDiff = vCol;
	  vec4 lighteffect = colDiff;
	  gl_FragColor = lighteffect;
	}
	</script>

	   function getPowerOfTwo(value) {

	   function handleLoadedTexture(texture, textureCanvas) {
	     gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);

	     gl.bindTexture(gl.TEXTURE_2D, texture);
	     gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, textureCanvas);

	       var w = image.width;

	       var canvasX = getPowerOfTwo(w);
	       var canvasY = getPowerOfTwo(h);
	       canvas.width = canvasX;
	       canvas.height = canvasY;

	       handleLoadedTexture(texture, canvas);

  	   var whichSubscene = function(coords){
         if (0 <= coords.x && coords.x <= 498.0545 && 0 <= coords.y && coords.y <= 498.0545) return(1);
         return(1);
       }

       var translateCoords = function(subsceneid, coords){
         return {x:coords.x - vpx0[subsceneid], y:coords.y - vpy0[subsceneid]};
       }
       
       var vlen = function(v) {
	     return sqrt(v[0]*v[0] + v[1]*v[1] + v[2]*v[2])
	   }
	   
	   var xprod = function(a, b) {
	     return [a[1]*b[2] - a[2]*b[1],
	             a[2]*b[0] - a[0]*b[2],
	             a[0]*b[1] - a[1]*b[0]];
	   }

	   var screenToVector = function(x, y) {
	     var width = vpWidths[activeSubscene];
	     var height = vpHeights[activeSubscene];
	     var radius = max(width, height)/2.0;
	     var cx = width/2.0;
	     var cy = height/2.0;
	     var px = (x-cx)/radius;
	     var py = (y-cy)/radius;
	     var plen = sqrt(px*px+py*py);
	     if (plen > 1.e-6) { 
	       px = px/plen;
	       py = py/plen;
	     }

	     var angle = (SQRT2 - plen)/SQRT2*PI/2;
	     var z = sin(angle);
	     var zlen = sqrt(1.0 - z*z);
	     px = px * zlen;
	     py = py * zlen;
	     return [px, py, z];
	   }

	   var rotBase;

	   var trackballdown = function(x,y) {
	     rotBase = screenToVector(x, y);
             var l = listeners[activeModel[activeSubscene]];
             saveMat = new Object();
             for (var i = 0; i < l.length; i++) 
               saveMat[l[i]] = new CanvasMatrix4(userMatrix[l[i]]);
	   }
	   
	   var trackballmove = function(x,y) {
	     var rotCurrent = screenToVector(x,y);
	     var dot = rotBase[0]*rotCurrent[0] + 
	   	       rotBase[1]*rotCurrent[1] + 
	   	       rotBase[2]*rotCurrent[2];
	     var angle = acos( dot/vlen(rotBase)/vlen(rotCurrent) )*180./PI;
	     var axis = xprod(rotBase, rotCurrent);
             var l = listeners[activeModel[activeSubscene]];
             for (i = 0; i < l.length; i++) {
	       userMatrix[l[i]].load(saveMat[l[i]]);
	       userMatrix[l[i]].rotate(angle, axis[0], axis[1], axis[2]);
             }
             drawScene();
	   }

	   var y0zoom = 0;
	   var zoom0 = 0;
	   var zoomdown = function(x, y) {
	     y0zoom = y;
	     zoom0 = new Object();
             l = listeners[activeProjection[activeSubscene]];
             for (i = 0; i < l.length; i++)
               zoom0[l[i]] = log(zoom[l[i]]);
	   }

	   var zoommove = function(x, y) {
             l = listeners[activeProjection[activeSubscene]];
             for (i = 0; i < l.length; i++)
	       zoom[l[i]] = exp(zoom0[l[i]] + (y-y0zoom)/height);
	     drawScene();
	   }

	   var y0fov = 0;

	   var fovdown = function(x, y) {

               fov0 = fov[l[i]];
	   }

	   var fovmove = function(x, y) {
             l = listeners[activeProjection[activeSubscene]];
             for (i = 0; i < l.length; i++)
	       fov[l[i]] = max(1, min(179, fov0[l[i]] + 180*(y-y0fov)/height));
	     drawScene();
	   }

	   var mousedown = [trackballdown, zoomdown, fovdown];
	   var mousemove = [trackballmove, zoommove, fovmove];

	   function relMouseCoords(event){
	     var totalOffsetX = 0;
	     var totalOffsetY = 0;
	     var currentElement = canvas;
	   
	     do{
	       totalOffsetX += currentElement.offsetLeft;
	       totalOffsetY += currentElement.offsetTop;
	       currentElement = currentElement.offsetParent;
	     }
	     while(currentElement)
	   
	     var canvasX = event.pageX - totalOffsetX;
	     var canvasY = event.pageY - totalOffsetY;
	   
	     return {x:canvasX, y:canvasY}
	   }
	   
	   canvas.onmousedown = function ( ev ){
	     if (!ev.which) // Use w3c defns in preference to MS
	       switch (ev.button) {
	       case 0: ev.which = 1; break;
	       case 1: 
	       case 4: ev.which = 2; break;
	       case 2: ev.which = 3;
	     }
	     drag = ev.which;
	     var f = mousedown[drag-1];
	     if (f) {
	       var coords = relMouseCoords(ev);
	       coords.y = height-coords.y;
	       activeSubscene = whichSubscene(coords);
	       coords = translateCoords(activeSubscene, coords);
	       f(coords.x, coords.y); 
	       ev.preventDefault();
	     }
	   }    

	   canvas.onmouseup = function ( ev ){	
	     drag = 0;
	   }
	   
	   canvas.onmouseout = canvas.onmouseup;

	   canvas.onmousemove = function ( ev ){
	     if ( drag == 0 ) return;
	     var f = mousemove[drag-1];
	     if (f) {
	       var coords = relMouseCoords(ev);
	       coords.y = height - coords.y;
	       coords = translateCoords(activeSubscene, coords);
	       f(coords.x, coords.y);
	     }
	   }

	   var wheelHandler = function(ev) {
	     var del = 1.1;
	     if (ev.shiftKey) del = 1.01;
	     var ds = ((ev.detail || ev.wheelDelta) > 0) ? del : (1 / del);
	     l = listeners[activeProjection[activeSubscene]];
             for (i = 0; i < l.length; i++)
               zoom[l[i]] *= ds;
	     drawScene();
